import React from 'react';
import EmbroideryCalculator from './components/EmbroideryCalculator';
import FileUpload from './components/FileUpload';

function App() {
  return (
    <div className="App">
      <h1>Embroidery Order Form</h1>
      <FileUpload />
      <EmbroideryCalculator />
    </div>
  );
}

export default App;
